import React, { useState, useEffect } from "react";
import { Bar } from "react-chartjs-2";

export default function Chart() {
  return (
    <div className="container">
      <h2>Chart</h2>
      <Bar
        data={{
          labels: ["Red", "Blue", "Yellow", "Green", "Purple", "Orange"],
          datasets: [
            {
              label: "# of Votes",
              data: [12, 19, 3, 5, 2, 3],
              backgroundColor: [
                "rgba(255, 99, 132, 0.5)",
                "rgba(54, 162, 235, 0.5)",
                "rgba(255, 206, 86, 0.5)",
                "rgba(75, 192, 192, 0.5)",
                "rgba(153, 102, 255, 0.5)",
                "rgba(255, 159, 64, 0.5)",
              ],
              borderColor: [
                "rgba(255, 99, 132, 1)",
                "rgba(54, 162, 235, 1)",
                "rgba(255, 206, 86, 1)",
                "rgba(75, 192, 192, 1)",
                "rgba(153, 102, 255,1)",
                "rgba(255, 159, 64, 1)",
              ],
              borderWidth: 1,
            },
            {
                label: "chart2",
              data: [12, 19, 3, 5, 2, 3],
              backgroundColor:"blue"
            }
          ],
        }}
        width={100}
        height={50}
        options={{ maintainAspectRatio: true }}
      />
    </div>
  );
}
